import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { Provider } from "react-redux";
import { RecipesDetailsScreen } from "./src/components/RecipesEpic/RecipesDetailsScreen";
import { RecipesListScreen } from "./src/components/RecipesEpic/RecipesList";
import { recipesList } from "./src/redux/reducers/recipiesList";
import store from "./src/redux/store";

export default function App() {
  return (
    <Provider store={store}>
      <View style={styles.container}>
        <RecipesListScreen></RecipesListScreen>

        <RecipesDetailsScreen></RecipesDetailsScreen>
      </View>
    </Provider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
